import React, { useState } from 'react';
import "./contact.css"
// Contact component
function Contact() {
  // State variables for form fields
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');
  
  // Function to handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // You can add code here to handle form submission, such as sending an email
    console.log('Form submitted:', { name, email, message });
    // Clear form fields after submission
    setName('');
    setEmail('');
    setMessage('');
  };

  return (
    <div className="container">
      <h2 className="heading">Contact Us</h2>
      <p className="paragraph">
        Have questions or feedback? Fill out the form below to get in touch with us.
      </p>
      <form onSubmit={handleSubmit} className="contact-form">
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input 
            type="text" 
            id="name" 
            value={name} 
            onChange={(e) => setName(e.target.value)} 
            required 
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email</label>
          <input 
            type="email" 
            id="email" 
            value={email} 
            onChange={(e) => setEmail(e.target.value)} 
            required 
          />
        </div>
        <div className="form-group">
          <label htmlFor="message">Message</label>
          <textarea 
            id="message" 
            value={message} 
            onChange={(e) => setMessage(e.target.value)} 
            rows="5" 
            required
          ></textarea>
        </div>
        <button type="submit" className="btn-submit">Submit</button>
      </form>

      {/* Social media links */}
      <div className="social-links">
        <a href="https://www.instagram.com/your_instagram" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-instagram"></i>
        </a>
        <a href="https://twitter.com/your_twitter" target="_blank" rel="noopener noreferrer">
          <i className="fab fa-twitter"></i>
        </a>
        {/* Add more social media icons as needed */}
      </div>
    </div>
  );
}

export default Contact;
